import { Component } from '@angular/core';
import { IonicPage, NavController, NavParams, ViewController, Platform } from 'ionic-angular';

import { ImagePicker } from '@ionic-native/image-picker/ngx';
import { Apparel } from '../../models/apparel';
import { PropertyGroupService } from '../../services/property-group-service';
import { ItemServiceProvider } from '../../services/item-service';
import { ImageCompressService, ResizeOptions, SourceImage } from 'ng2-image-compress';

const defaultResize = new ResizeOptions();
defaultResize.Resize_Quality = 90;
defaultResize.Resize_Max_Width = 1440;

@IonicPage()
@Component({
	selector: 'page-item-form',
	templateUrl: 'item-form.html',
})
export class ItemFormPage {

	// VARS
  profileImages: any[];

  public item: Apparel;
  public tags: string[] = [];
  public propertyGroups = [];

  public category: string = "";
  public type: string = "";
  public age: string = "";
  public size: string = "";
  public modeling: string = "";
  public pattern: string = "";
  public color: string = "";

	// CONSTRUCTOR
	constructor(
		public navCtrl: NavController,
		public navParams: NavParams,
		public viewCtrl: ViewController,
		public imagePicker: ImagePicker,
    private propertyGroupService: PropertyGroupService,
    private itemService: ItemServiceProvider,
    private platform: Platform,
	) {
		this.init();
	}

	init() {
    this.profileImages = [
			'assets/img/dummy/blusa.jpg',
			'assets/img/dummy/blusa.jpg',
			'assets/img/dummy/blusa.jpg',
			''
    ];

    this.category = "1";
    this.type = "1";
    this.age = "1";
    this.size = "1";
    this.modeling = "1";
    this.pattern = "1";
    this.color = "1";
	}

	// LIFECYCLE EVENTS
	ionViewDidLoad() {
    this.loadItem();
  }

  async loadItem() {
    const item = this.navParams.data.item;
    const finalItem = item ? Object.assign(new Apparel, JSON.parse(JSON.stringify(item))) : new Apparel;
    await this.reloadPropertyGroups(finalItem);

    if (!finalItem.apparel_property)
      finalItem.apparel_property = { };
    this.item = finalItem;
    this.tags = this.item.apparel_tags.map(v => v.name);
  }

  reloadPropertyGroups(item) {
    const propertyGroups = [];
    this.loadRootGroups(propertyGroups, item);

    this.propertyGroups = propertyGroups.sort((a, b) => a.sort_order - b.sort_order);
  }

  public async loadRootGroups(propertyGroups, entry) {
    const groups = await this.propertyGroupService.root();
    return await groups.map(async (group) => await this.doAddPropertyGroup(propertyGroups, group, null, entry));
  }

  public async groupPropertySelectionChanged(group) {
    const newValue = this.item.apparel_property[group.prop_name];
    const propertyGroups = this.propertyGroups.slice(0);
    await this.doGroupPropertySelectionChanged(propertyGroups, group, newValue, this.item);
    this.propertyGroups = propertyGroups.sort((a, b) => a.sort_order - b.sort_order);
  }

  private async doAddPropertyGroup(propertyGroups, group, parentGroup, entry) {
    propertyGroups.push(group);
    var groupIndex = propertyGroups.length - 1;
    if (parentGroup) {
      if (!parentGroup.childrenGroups)
        parentGroup.childrenGroups = [];
      parentGroup.childrenGroups.push(group);
    }
    var selectedId = entry.apparel_property[group.prop_name];
    if (selectedId) {
      const childrenGroups = await this.loadChildGroups(propertyGroups, group, selectedId, entry);
    } else {
      entry.apparel_property[group.prop_name] = null;
    }
    return group;
  }

  private async loadChildGroups(propertyGroups, parentGroup, selectedId, entry) {
    const childrenGroups = await this.propertyGroupService.children(parentGroup.id, selectedId);
    return await childrenGroups.map(async (group) => await this.doAddPropertyGroup(propertyGroups, group, parentGroup, entry));
  }

  private async doGroupPropertySelectionChanged(propertyGroups, group, newValue, entry) {
    if (group.childrenGroups) {
      for (var i = 0; i < group.childrenGroups.length; i++) {;
        var childGroup = group.childrenGroups[i];
        var childIndex = propertyGroups.indexOf(childGroup);
        if (childIndex > -1) {
          propertyGroups.splice(childIndex, 1);
          await this.doGroupPropertySelectionChanged(propertyGroups, childGroup, null, entry);
        }
      }
    }

    if (newValue) {
      if (!group.loading) {
        group.loading = true;
        try {
          await this.loadChildGroups(propertyGroups, group, newValue, entry)
        } finally {
          group.loading = false;
        }
      }
    } else {
      // caso o valor da propriedade esteja preenchida entao limpa
      entry.apparel_property[group.prop_name] = null;
    }
  }

  private processTags() {
    const apparelTags = this.item.apparel_tags.slice(0);
    const newTags = [];
    for (const tagName of this.tags) {
      const found = apparelTags.find(item => item.name === tagName);
      if (found) {
        const idx = apparelTags.indexOf(found);
        apparelTags.splice(idx, 1);
      } else {
        newTags.push({ name: tagName });
      }
    }

    for (const notKeptTag of apparelTags) {
      notKeptTag['_destroy'] = true;
    }
    Array.prototype.push.apply(apparelTags, newTags);
    this.item.apparel_tags = apparelTags;
  }

	// CLICK EVENTS
	async save() {
    this.processTags();
    await this.itemService.save(this.item);
		// TODO : IMPLEMENTAR SAVE
		this.viewCtrl.dismiss(true);
  }

  delete() {
		// TODO : IMPLEMENTAR DELETE
		this.viewCtrl.dismiss();
  }

  cancel() {
		// TODO : IMPLEMENTAR CANCEL
		this.viewCtrl.dismiss();
	}

	async openPhotoPicker(index) {
    let results;
    if (this.platform.is('cordova')) {
      results = await this.imagePicker.getPictures({ maximumImagesCount: 1 });
    } else {
      results = ['data:image/png;base64,']
    }

    const image = new SourceImage();
    image.imageDataUrl = results[0];
    const processedImages = await ImageCompressService.IImageListToCompressedImageSourceEx([ image ], defaultResize);
    if (index < this.item.apparel_images.length) {
      delete this.item.apparel_images['_destroy'];
      delete this.item.apparel_images['file_url'];
      this.item.apparel_images[index].data = processedImages[0].compressedImage.imageDataUrl;
    } else {
      this.item.apparel_images.push({ data: processedImages[0].compressedImage.imageDataUrl })
    }

  }

  hasImage(index) {
    return index < this.item.apparel_images.length && !this.item.apparel_images[index]._destroy;
  }

	removeImage(index) {
    const image = this.item.apparel_images[index];
    if (image.id) {
      image['_destroy'] = true;
    } else {
      this.item.apparel_images.splice(index, 1);
    }
  }

  togglePhotoPicker(index) {
    if (this.hasImage(index)) {
      this.removeImage(index);
    } else {
      this.openPhotoPicker(index);
    }
  }

}
